import emailjs from "emailjs-com";
import React from 'react';

export default function ContactUs() {

    function sendEmail(e) {
        e.preventDefault();

    emailjs.sendForm('gmail', 'template_mycoder', e.target, 'user_99ogBoikg8ImrHb1RSNcB')
        .then((result) => {
            console.log(result.text);
        }, (error) => {
            console.log(error.text);
        });
        e.target.reset()
    }

    return(
        <>
        <img src="data:image/png;base64," width="300" class="imgg" alt="display image" />
            <form action=""  onSubmit={sendEmail}>
                    <div className="row pt-5 mx-auto">
                        <div className="center">
                        <span>Email Address</span> <br></br>
                            <input type="text" className="form-control"  placeholder="Email Address" name="email"/>
                        </div>
                        <div className="cente">
                        <span>Password</span>
                            <input type="password"  className="form-control" placeholder="password" name="name" />
                        </div>
                        <div className="col-8 pt-3 mx-auto">
                            <input type="submit" className="btn btn-info" value="Send Message"></input>
                        </div>
                    </div>
                </form>
        </>
       
    )
}
